import React from 'react';
import '../App.css';

class ListContent extends React.Component {

  render() {
    return (
      <div className="App">
        <h1>Main Menu for Game Database</h1>
        <h2>It is {new Date().toLocaleTimeString()}.</h2>
      </div>
    );
  }
}

export default ListContent;
